import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import './css/style.css';
import * as serviceWorker from './serviceWorker';
import ReactPlayer from 'react-player';

const videos = ['https://www.youtube.com/watch?v=35lXWvCuM8o',
                'https://www.youtube.com/watch?v=DLX62G4lc44',
                'https://www.youtube.com/watch?v=DLX62G4lc44',
                'https://www.youtube.com/watch?v=35lXWvCuM8o',
                'https://www.youtube.com/watch?v=CVpUuw9XSjY']

class A extends React.Component{
  render(){
    return (
    <div class="grid-container">
      <div ><App url='https://www.youtube.com/watch?v=CVpUuw9XSjY'/></div>
      <div >  <App/></div>
      <div >  <App/></div>  
      <div >  <App/></div>
      <div >  <App/></div>
      <div >  <App/></div>  
      <div >  <App/></div>
      <div >  <App/></div>
      <div >  <App/></div>  
      <div >  <App/></div>
      <div >  <App/></div>
      <div >  <App/></div>  
    </div>);
  }
} 

class App extends React.Component {
  render() {
    return (
      <div>
        <ReactPlayer
          // url='https://www.youtube.com/watch?v=35lXWvCuM8o'
          url={this.props.url}
          className='react-player'
          playing
          width='100%'
          height='100%'
        />
      </div>
    );
  }
}
ReactDOM.render(
  <A/>,document.getElementById('root')
);


// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
